import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import App from './App';
import AdminProfile from './AdminProfile'; // Importa el componente AdminProfile

ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/admin-profile" element={<AdminProfile />} /> {/* Define la ruta para AdminProfile */}
    </Routes>
  </Router>,
  document.getElementById('root')
);
